import { Text, View } from "react-native";
import React, { PureComponent } from "react";
import { FlatList, StyleSheet } from "react-native-web";

const FlatDemo = () => {
  const names = [
    {
      key: "1",
      name: "Ruby",
    },
    {
      key: "2",
      name: "Jain",
    },
    {
      key: "3",
      name: "Kriti",
    },
    {
      key: "4",
      name: "Sanon",
    },
  ];

  return (
    <FlatList
      data={names}
      renderItem={(element) => {
        console.log(element.item.name);
        return <Text style={styles.txt}>{element.item.name}</Text>;
      }}
    />
  );
};
const styles = StyleSheet.create({
  txt: {
    fontWeight: "bold",
    fontSize: 30,
  },
});

export default FlatDemo;
